import React, { useEffect, useState } from 'react';
import CardList from '../../components/CardList/CardList';

const StorePage = (props) => {

    const { addToFavorite, setModalProps, setIsModalActive, data } = props

    return (

        <CardList addToFavorite={addToFavorite} setModalProps={setModalProps} setIsModalActive={setIsModalActive} data={data} />
    );
}

export default StorePage;
